import React from 'react';
import './App.css';

import ReactPlayer from 'react-player'


function App() {

  const onClick = {
    play: () => {
      ReactPlayer.canPlay('https://vimeo.com/575873877')
    }
  }

  return (
    <div className="App">

        <div className="player-wrapper">
          <ReactPlayer
            className="react-player"
            url={'https://vimeo.com/575873877'}
            autoPlay={true}
            width={'100%'}
            height={'100%'}
          />
         </div>

         <button type="button" onClick={onClick.play}>Play</button>
    </div>
  );
}

export default App;
